const Icon = ({ type, className, color, width, height, ...props }) => {
    switch (type) {
        case 'home':
            return <Home />;
        case 'dropdown':
            return <Dropdown width={width} height={height} />;
        case 'projects':
            return <Projects />;
        case 'submissions':
            return <Submissions width={width} height={height} />;
        case 'community':
            return <Community />;
        case 'team':
            return <Team width={width} height={height} />;
        case 'settings':
            return <Settings />;
        case 'color_picker':
            return <ColorPicker />;
        case 'edit_settings':
            return <EditSettings />;
        case 'dragdrop':
            return <DragDrop />;
        case 'comments':
            return <Comments />;
        case 'in_development':
            return <InDevelopment />;
        case 'popularity':
            return <Popularity name={className} {...props} />;
        case 'notification':
            return <Notifications />;
        case 'share':
            return <Share {...props} />;
        case 'task_voting':
            return <TaskVoting />;
        case 'upvote':
            return <Upvote />;
        case 'upvoted':
            return <Upvoted />;
        case 'highlight':
            return <Highlight />;
        case 'high_five':
            return <HighFive />;
        case 'multi_tasks':
            return <MultiTasks {...props} />;
        case 'question':
            return (
                <Question
                    color={color}
                    width={width}
                    height={height}
                    {...props}
                />
            );
        case 'community_suggested':
            return <CommunitySuggested />;
        case 'check_mark':
            return <CheckMark />;
        case 'deny':
            return <Deny />;
        case 'warning_sign':
            return <WarningSign />;
        case 'trash':
            return <Trash />;
        case 'check_circle':
            return <CheckCircle />;
        case 'pencil':
            return <Pencil />;
        case 'user_account':
            return <UserAccount />;
        case 'plus':
            return <Plus />;
        case 'info':
            return <Info {...props} />;
        case 'banned_members':
            return <BannedMembers {...props} />;
        case 'simple_pencil':
            return <SimplePencil />;
        case 'quest_circle':
            return <QuestionCircle {...props} />;
        case 'tab':
            return <Tab />;
        case 'open':
            return <Open {...props} />;
        default:
            return <div></div>;
    }
};

export default Icon;
